Veronica is a reporter on the scene for ZZ News. She interviews the soccer team of Jordan, John, James, Marco and Erik who have once again lost in the finals of the Brazzers cup. After a series of scathing insults, the team has had enough of Veronica's questions and decide to take the frustration of their loss out on her. Five to One Baby!
